import React from "react";
import './App.css';
//importing Components
import Form from './components/Form';
import TodoList from "./components/TodoList";

function App() {
  return (
    <div className="App">
      <header>
      <h1>Dat's todo list</h1>
      </header>
      <Form/>
      <TodoList/>
    </div>
  );
}

export default App;
